//import logo from './logo.svg';
import './App.css';
import 'bootstrap/dist/css/bootstrap.min.css';
import Navbar from 'react-bootstrap/Button';
function App() {
  return (
    <div>
    <Navbar bg="dark">
    <Navbar.Brand href="#home">
      <img
        src="/inq.png"
        width="30"
        height="30"
        className="d-inline-block align-top"
        alt="React Bootstrap logo"
      />
    </Navbar.Brand>
  </Navbar>
    </div>
  );
}

export default App;
